INSERT INTO `catalog_categories` VALUES (3,'2016-04-21 10:16:54','2019-08-30 15:45:02',NULL,'Шкафы',1,20,'shkafyi','Шкафы на заказ','<p>Мы занимаемся изготовлением шкафов на заказ по индивидуальным размерам в Москве и Московской области. У нас можно заказать шкаф по своим размерам. Ниже представлены фотографии наших работ. Если из каталога ничего не приглянулось, мы соберем шкаф специально для Вас. Для этого достаточно иметь представления о том, какую модель хотите или воспользуйтесь нашим <a href=\"/constructor\">калькулятором</a> и соберите ее там. Если есть вопросы звоните по номеру +7 (495) 132-13-13.</p>','Шкафы на заказ по индивидуальным размерам — заказать в Москве, недорого, фото','','Наша компания занимается изготовление шкафов на заказ по индивидуальным размерам. У нас можно недорого заказать как готовы шкаф, так и изготовленный по своим размерам. Доставляем и устанавливаем в Москве и Московской области. Звоните!','<h2>Преимущества заказа у нас:</h2>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 25%; text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/images/advantages/3 Выбор фурнитуры и материалов.png\" alt=\"\" /></td>\r\n<td style=\"width: 25%; text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/images/advantages/1 Индивидуальный проект.png\" alt=\"\" /></td>\r\n<td style=\"width: 25%; text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/images/advantages/8 Профессионалы.png\" alt=\"\" /></td>\r\n<td style=\"width: 25%; text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/images/advantages/7 Экономия.png\" alt=\"\" /></td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 25%; text-align: center;\"><strong>Невероятное разнообразие.</strong><br />Всегда доступен большой выбор фурнитуры и материалов отделки.</td>\r\n<td style=\"width: 25%; text-align: center;\"><strong>Индивидуальный заказ.</strong><br />Мы сделаем мебель по любым Вашим пожеланиям и параметрам.</td>\r\n<td style=\"width: 25%; text-align: center;\"><strong>Команда профессионалов.</strong><br />В нашем штате опытные мастера своего дела (менеджеры, замерщики, дизайнеры).</td>\r\n<td style=\"width: 25%; text-align: center;\"><strong>Доступные цены.</strong><br />Идеальное соотношение цены и качества! Дешевле не найти!</td>\r\n</tr>\r\n</tbody>\r\n</table>','img1.png',1,'active_img1_1.png','Похожий шкаф',0,1,'<div class=\"block_uls\">\r\n<div class=\"title\">Комната</div>\r\n<ul>\r\n<li><a href=\"/type/shkafy-v-spalnyu\">В спальню</a></li>\r\n<li><a href=\"/type/shkafy-v-gostinuyu\">В гостиную</a></li>\r\n<li><a href=\"/type/shkafy-v-prihojuyu\">В прихожую</a></li>\r\n<li><a href=\"/type/shkaf-v-vannuyu\">В ванную</a></li>\r\n<li><a href=\"/type/shkafy-v-tualet\">В туалет</a></li>\r\n<li><a href=\"/type/shkafy-v-detskuyu\">В детскую</a></li>\r\n<li><a href=\"/type/shkaf-v-ofis\">В офис</a></li>\r\n<li><a href=\"/type/shkafy-v-kuhnyu\">На кухню</a></li>\r\n<li><a href=\"/type/shkafy-dlya-balkona\">На балкон</a></li>\r\n<li><a href=\"/type/shkafy-pod-lestnitsu\">Под лестницу</a></li>\r\n</ul>\r\n<div class=\"both\">&nbsp;</div>\r\n<div class=\"title\">Цена</div>\r\n<ul>\r\n<li><a href=\"/type/shkaf-dorogie\">Дорогие</a></li>\r\n<li><a href=\"/type/shkafy-ehkonom-klassa\">Эконом</a></li>\r\n</ul>\r\n</div>\r\n<div class=\"block_uls\">\r\n<div class=\"title\">Габариты</div>\r\n<ul>\r\n<li><a href=\"/type/bolshie-shkafy\">Большой</a></li>\r\n<li><a href=\"/type/malenkie-shkafy\">Маленький</a></li>\r\n<li><a href=\"/type/shkaf-vo-vsyu-stenu\">Широкий</a></li>\r\n<li><a href=\"/type/uzkie-shkafy\">Узкий</a></li>\r\n<li><a href=\"/type/vysokie-shkafy\">Высокий</a></li>\r\n<li><a href=\"/type/nizkie-shkafy\">Низкий</a></li>\r\n</ul>\r\n<div class=\"both\">&nbsp;</div>\r\n<div class=\"title\">Цвет</div>\r\n<ul>\r\n<li><a href=\"/type/shkafy-venge\">Венге</a></li>\r\n<li><a href=\"/type/shkafy-belye\">Белый</a></li>\r\n<li><a href=\"/type/shkafy-temnye\">Темный</a></li>\r\n<li><a href=\"/type/shkaf-krasnyiy\">Красный</a></li>\r\n<li><a href=\"/type/shkafy-oreh\">Орех</a></li>\r\n<li><a href=\"/type/shkaf-seryiy\">Серый</a></li>\r\n</ul>\r\n</div>\r\n<div class=\"block_uls\">\r\n<div class=\"title\">Размер (Глубина)</div>\r\n<ul>\r\n<li><a href=\"/type/glubina-shkafa-30-sm\">30 см</a></li>\r\n<li><a href=\"/type/glubina-shkafa-35-sm\">35 см</a></li>\r\n<li><a href=\"/type/glubina-shkafa-40-sm\">40 см</a></li>\r\n<li><a href=\"/type/glubina-shkafa-45-sm\"> 45 см</a></li>\r\n<li><a href=\"/type/glubina-shkafa-50-sm\">50 см</a></li>\r\n<li><a href=\"/type/glubina-shkafa-70-sm\">70 см</a></li>\r\n<li><a href=\"/type/glubina-shkafa-80-sm\">80 см</a></li>\r\n</ul>\r\n<div class=\"both\">&nbsp;</div>\r\n<div class=\"both\">&nbsp;</div>\r\n<div class=\"title\">Количество дверей</div>\r\n<ul>\r\n<li><a href=\"/type/shkafy-odnodvernye\">1 дверь</a></li>\r\n<li><a href=\"/type/shkafy-dvuhdvernye\">2 двери</a></li>\r\n<li><a href=\"/type/shkafy-trehdvernye\">3 дверь</a></li>\r\n<li><a href=\"/type/shkafy-chetyrehdvernye\">4 двери</a></li>\r\n</ul>\r\n</div>\r\n<div class=\"block_uls\">\r\n<div class=\"title\">Материал</div>\r\n<ul>\r\n<li><a href=\"/type/shkafy-dsp\">ДСП</a></li>\r\n<li><a href=\"/type/shkaf-ldsp\">ЛДСП</a></li>\r\n<li><a href=\"/type/shkafy-mdf\">МДФ</a></li>\r\n<li><a href=\"/type/shkafy-shpon\">Шпон</a></li>\r\n<li><a href=\"/type/shkaf-iz-sosnyi\">Сосна</a></li>\r\n<li><a href=\"/type/shkaf-dub-sonoma\">Дуб сонома</a></li>\r\n<li><a href=\"/type/shkafy-massiv\">Массив дерева</a></li>\r\n</ul>\r\n<div class=\"both\">&nbsp;</div>\r\n<div class=\"both\">&nbsp;</div>\r\n<div class=\"title\">Оформление</div>\r\n<ul>\r\n<li><a href=\"/type/shkaf-glyantsevyiy\">Глянцевый</a></li>\r\n<li><a href=\"/type/shkafy-s-peskostruem\">С пескоструем</a></li>\r\n<li><a href=\"/type/shkafy-s-fotopechatyu\">С фотопечатью</a></li>\r\n</ul>\r\n</div>\r\n<div cla