ern\">Модерн</a></li>\r\n<li><a href=\"/type/shkaf-provans\">Прованс</a></li>\r\n<li><a href=\"/raspashnye-shkafy/sovremennyiy\">Современный</a></li>\r\n</ul>\r\n</div>','','calculation'),(4,'2016-06-10 11:26:06','2019-08-30 16:39:37',NULL,'Шкафы-купе',1,30,'shkafy-kupe','Шкафы-купе на заказ','<p>Наша компания занимается производством шкафов-купе на заказ по индивидуальным размерам. Перед вами представлены фотографии наших работ. Вы можете заказать, как похожую модель, там и сделанную специально по вашим размерам и конфигурациям. У нас есть <a href=\"/constructor\">онлайн-калькулятор</a>, где можно составить дизайн своего шкафа-купе и рассчитать его примерную стоимость. Доставка, установка по Москве и Московской области. Звоните +7 (495) 132-13-13!</p>\r\n<p>&nbsp;</p>\r\n<div style=\"box-shadow: 0 5px 6px -6px #777; background: linear-gradient(to top, #e7dbc3, #d9c9a9); width: 99%; padding-top: 10px; padding-bottom: 10px;\" align=\"center\">\r\n<p><strong>Другие виды шкафов-купе</strong></p>\r\n<p><a style=\"color: #473936;\" href=\"/shkafy-kupe/prihojaya\">В прихожую</a> | <a style=\"color: #473936;\" href=\"/shkafy-kupe/spalniya\">В спальню</a> | <a style=\"color: #473936;\" href=\"/shkafy-kupe/gostinaya\">В гостиную</a> | <a style=\"color: #473936;\" href=\"/shkafy-kupe/kupe-s-zerkalom\">С зеркалом</a> | <a style=\"color: #473936;\" href=\"/shkafy-kupe/vstroennye\">Встроенные</a></p>\r\n</div>','Шкаф-купе на заказ по индивидуальным размерам | Заказать шкаф-купе в Москве недорого от производителя','','Компания Lit-mebel занимается изготовлением шкафов-купе на заказ по индивидуальным размерам. У нас можно купить недорогой шкаф-купе в Москве и МО. Доставка, установка и гарантии от производителя!','<h2>Преимущества заказа у нас:</h2><table><tbody><tr><td style=\"width: 25%; text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/images/advantages/2 Выезд замерщика.png\" alt=\"\" /></td><td style=\"width: 25%; text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/images/advantages/4 Быстрая доставка.png\" alt=\"\" /></td><td style=\"width: 25%; text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/images/advantages/6 Оперативность.png\" alt=\"\" /></td><td style=\"width: 25%; text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/images/advantages/8 Профессионалы.png\" alt=\"\" /></td></tr><tr><td style=\"width: 25%; text-align: center;\"><strong>Выезд замерщика в удобное время.</strong><br />Практически в любое время, подробнее по телефону +7 (495) 132-13-13.</td><td style=\"width: 25%; text-align: center;\"><strong>Быстрая доставка и сборка.</strong><br />Привезем готовый шкаф в любой уголок Москвы и области и быстро соберём его.</td><td style=\"width: 25%; text-align: center;\"><strong>Оперативность.</strong><br />Все работы проводятся в кратчайшие сроки, никаких задержек и срывов сроков.</td><td style=\"width: 25%; text-align: center;\"><strong>Команда профессионалов.</strong><br />В нашем штате опытные мастера своего дела (менеджеры, замерщики, дизайнеры.</td></tr></tbody></table>','kupe.png',1,'active_img1.png','Похожий шкаф',1,1,'<div class=\"block_uls\">\r\n<div class=\"title\">Комната</div>\r\n<ul>\r\n<li><a href=\"/shkafy-kupe/prihojaya\">В прихожую</a></li>\r\n<li><a href=\"/shkafy-kupe/spalniya\">В спальню</a></li>\r\n<li><a href=\"/shkafy-kupe/gostinaya\">В гостиную</a></li>\r\n<li><a href=\"/shkafy-kupe/detskaya\">В детскую</a></li>\r\n<li><a href=\"/shkafy-kupe/kladovka\">В кладовку</a></li>\r\n</ul>\r\n<div class=\"both\">&nbsp;</div>\r\n<div class=\"title\">Комплектация</div>\r\n<ul>\r\n<li><a href=\"/shkafy-kupe/kupe-s-zerkalom\">С зеркалом</a></li>\r\n<li><a href=\"/shkafy-kupe/bez-zerkal\">Без зеркал</a></li>\r\n<li><a href=\"/shkafy-kupe/kupe-so-steklom\">Со стеклом</a></li>\r\n<li><a href=\"/shkafy-kupe/kupe-s-yaschikami\">С ящиками