-shkafy','Распашные шкафы на заказ','<p>Мы изготовим любой распашной шкаф на заказ по индивидуальным размерам в кратчайшие сроки, с учетом ваших пожеланиям по внутреннему наполнению, дизайну и цене. Ниже представлены фотографии наших работ.</p>\r\n<p>&nbsp;</p>\r\n<div style=\"box-shadow: 0 5px 6px -6px #777; background: linear-gradient(to top, #e7dbc3, #d9c9a9); width: 99%; padding-top: 10px; padding-bottom: 10px;\" align=\"center\">\r\n<p><strong>Обратите внимание на представленные виды распашных шкафов в нашем каталоге</strong></p>\r\n<p><a style=\"color: #473936;\" href=\"/raspashnye-shkafy/vstraivaemye\">встроенные</a> | <a style=\"color: #473936;\" href=\"/raspashnye-shkafy/dvuhstvorchatyiy\">двухстворчатые</a> | <a style=\"color: #473936;\" href=\"/raspashnye-shkafy/trehstvorchatyie\">трёхстворчатые</a> | <a style=\"color: #473936;\" href=\"/raspashnye-shkafy/s-polkami\">с полками</a> | <a style=\"color: #473936;\" href=\"/raspashnye-shkafy/s-zerkalom\">с зеркалом</a> | <a style=\"color: #473936;\" href=\"/raspashnye-shkafy/s-yaschikami\">с ящиками</a> | <a style=\"color: #473936;\" href=\"/raspashnye-shkafy/spalnya\">в спальню</a></p>\r\n</div>','Распашные шкафы на заказ | Купить распашной шкаф по индивидуальным размерам в Москве, недорого','распашные шкафы на заказ','Наша компания занимается производством распашных шкафов на заказа. У нас можно купить недорогие шкафы с распашными дверями по индивидуальным размерам и с любой конфигурацией. Доставка и установка по Москве и МО. Звоните!','<h2>Виды распашных шкафов:</h2>\r\n<ul>\r\n<li>подвесные шкафчики в ванной комнате для хранения аксессуаров и средств по уходу за телом.</li>\r\n<li>большие шкафы с книжными стеллажами на всю стену в библиотеке.</li>\r\n<li>гардеробные шкафы с распашными дверями&nbsp;или системы хранения в гостиной с возможностью установки телевизора и другой техники в открытых секциях.</li>\r\n</ul>\r\n<p>Мы решаем задачи любого уровня сложности!</p>\r\n<h2>Преимущества заказа у нас:</h2>\r\