зеркалом</a></li>\r\n<li><a href=\"/raspashnye-shkafy/s-yaschikami\">С ящиками</a></li>\r\n<li><a href=\"/raspashnye-shkafy/s-antresolyu\">С антресолью</a></li>\r\n<li><a href=\"/raspashnye-shkafy/so-steklom\">Со стеклом</a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','specify'),(6,'2016-06-10 11:26:26','2019-08-30 16:39:37',NULL,'Стеллажи',1,50,'stellaji','Стеллажи для дома на заказ','<p>Компания Lit-mebel.ru изготавливает шкафы-стеллажи по индивидуальным размерам. Они хорошо подходят для зонирования комнаты, для книг. Предлагаем большой выбор материалов (металлические, ДСП и т.д.) и вариантов отделки стеллажей на заказ. Доставляем по Москве и всей Московской области.</p>','Шкафы стеллажи на заказ по индивидуальным размерам – купить в Москве недорого прямо от производителя','шкафы стеллажи на заказ','Мы изготавливаем шкафы-стеллажи на заказ по индивидуальным размерам. У нас можно недорого купить стеллажи для дома по своим размерам с доставкой по Москве и области от производителя - Lit-mebel.','<p>Стеллажи используются в разных комнатах:</p><ul><li>Гостиная. Обратите внимание на оригинальные и функциональные тумбы под телевизор с навесными полками, закрытыми и открытыми ящиками и шкафами. Их количество, вид и размер можно выбрать по своему вкусу и финансовым возможностям.</li><li>Кабинет. Элегантные стеллажи для хранения книг или полки для дисков и документации, которые могут располагаться прямо над компьютерным столом.</li><li>Спальня. В нашем каталоге представлены тумбы под телевизор, комоды, полки и шкафчики. Изящные внешне и занимающие минимум площади, они способны сделать вашу спальню местом полноценного отдыха после непростого рабочего дня.</li><li>Детская. Для компактных комнат мы предлагаем лаконичные, но вместительные шкафы-пеналы и занимающие минимум места подоконники-столешницы для детского рабочего места, которые удачно комплектуются тумбой и книжным шкафом.</li><li>Библиотека. У нас вы можете заказать закрытые и открытые книжные шкафы, с антресолями и без, различной вместительности и габаритов.</li></ul><p>Безупречное качество исполнения, широта выбора и приемлемые цены &ndash; вот то, что заставляет клиентов возвращаться к нам вновь.</p><h2>Преимущества заказа у нас:</h2><table><tbody><tr><td style=\"width: 25%; text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/images/advantages/3 Выбор фурнитуры и материалов.png\" alt=\"\" /></td><td style=\"width: 25%; text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/images/advantages/6 Оперативность.png\" alt=\"\" /></td><td style=\"width: 25%; text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/images/advantages/8 Профессионалы.png\" alt=\"\" /></td><td style=\"width: 25%; text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/images/advantages/2 Выезд замерщика.png\" alt=\"\" /></td></tr><tr><td style=\"width: 25%; text-align: center;\"><strong>Невероятное разнообразие.</strong><br />Всегда доступен большой выбор фурнитуры и материалов отделки.</td><td style=\"width: 25%; text-align: center;\"><strong>Оперативность.</strong><br />Все работы проводятся в кратчайшие сроки, никаких задержек и срывов сроков.</td><td style=\"width: 25%; text-align: center;\"><strong>Команда профессионалов.</strong><br />В нашем штате опытные мастера своего дела (менеджеры, замерщики, дизайнеры).</td><td style=\"width: 25%; text-align: center;\"><strong>Выезд замерщика в удобное время.</strong><br />Практически в любое время, подробнее по телефону +7 (495) 132-13-13</td></tr></tbody></table>','polki.png',1,'active_img4.png','Похожий стеллаж',1,0,'','','calculation'),(7,'2016-06-10 11:26:36','2019-08-30 15:45:02',NULL,'Гардеробные',1,60,'garderobnye','Гардеробные на заказ','<p>Компания Lit-mеbеli изготавливает гардеробные на заказ по индивидуальным размерам. Вы можете заказать у нас модель абсолютно идентичную представленной в каталоге или ту, которая будет выполнена точно по вашим предпочтениям. Бесплатная доставка и установка по Москве и Московской области.</p>\r\n<p>&nbsp;</p>\r\n<div style=\"box-shadow: 0 5px 6px -6px #777; background: linear-gradient(to top, #e7dbc3, #d9c9a9); width: 99%; padding-top: 10px; padding-bottom: 10px;\" align=\"center\">\r\n<p><strong>Обратите внимание на представленные виды гардеробных в нашем каталоге</strong></p>\r\n<p><a style=\"color: #473936;\" href=\"/shkafy-kupe/garderobnyie\">гардеробные-купе</a></p>\r\n</div>','Гардеробные на заказ по индивидуальным размерам — недорого в Москве, отзывы','гардеробные на заказ','Гардеробные на заказ по индивидуальным размерам. Заказать недорогой гардеробный шкаф по своему дизайну с доставкой по Москве и МО. Низкие цены от производителя. Lit-mebel.','<p>Гардеробные шкафы от Lit-mebel.ru &ndash; это комфорт, функциональность и максимум полезного пространства для хранения вещей. Вы можете выбрать:</p><ul><li>дизайн и функционал системы;</li><li>размеры конструкции;</li><li>цветовое решения.</li></ul><p>Легкая, но прочная конструкция гардеробного шкафа, включающая в себя выдвижные ящики, полки для обуви и одежды, изготавливается таким образом, чтобы задействовать каждый сантиметр свободной площади и занять при этом минимум пространства. С появлением такой мебели в доме, как правило, становится больше порядка, поскольку у каждой вещи теперь есть свое место.</p><h2>Почему стоит обратиться именно к нам:</h2><table><tbody><tr><td style=\"width: 25%; text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/images/advantages/5 Без посредников.png\" alt=\"\" /></td><td style=\"width: 25%; text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/images/advantages/6 Оперативность.png\" alt=\"\" /></td><td style=\"width: 25%; text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/cc_uploads/style.png\" alt=\"\" /></td><td style=\"width: 25%; text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/images/advantages/2 Выезд замерщика.png\" alt=\"\" /></td></tr><tr><td style=\"width: 25%; text-align: center;\"><strong>Без лишней наценки.</strong><br />Почему мы гарантируем это? Всё просто - никаких посредников, мы &mdash; производитель!</td><td style=\"width: 25%; text-align: center;\"><strong>Оперативность.</strong><br />Все работы проводятся в кратчайшие сроки, никаких задержек и срывов сроков.</td><td style=\"width: 25%; text-align: center;\"><strong>Мебель любых стилей.</strong><br />От классики до модерна, от минимализма до хай-тека - мы можем всё!</td><td style=\"width: 25%; text-align: center;\"><strong>Выезд замерщика в удобное время.</strong><br />Практически в любое время, подробнее по телефону +7 (495) 132-13-13.</td></tr></tbody></table>','gard.png',1,'active_img6.png','Похожая гардеробная',0,0,'','','specify'),(8,'2016-06-10 11:26:45','2019-08-30 15:45:02',NULL,'Прихожие',1,70,'prihojie','Прихожие со шкафом на заказ','<p>Прихожие на заказ по индивидуальным размерам - это возможность организовать пространство с наибольшим комфортом. Вы можете приобрести у нас прихожую с обычными шкафами, шкафами-купе по своим размерам, конфигурациям и стилевым решением комнаты. Бесплатно доставляем и устанавливаем по Москве и Московской области.</p>\r\n<p>&nbsp;</p>\r\n<div style=\"box-shadow: 0 5px 6px -6px #777; background: linear-gradient(to top, #e7dbc3, #d9c9a9); width: 99%; padding-top: 10px; padding-bottom: 10px;\" align=\"center\">\r\n<p><strong>Обратите внимание на представленные виды прихожих в нашем каталоге</strong></p>\r\n<p><a style=\"color: #473936;\" href=\"/type/vstroennye-shkafy-v-prihojuyu\">встроенные шкафы</a> | <a style=\"color: #473936;\" href=\"/type/uglovye-shkafy-v-prihojuyu\">угловые шкафы</a> | <a style=\"color: #473936;\" href=\"/shkafy-kupe/prihojaya\">шкафы-купе</a></p>\r\n</div>','Прихожая на заказ по индивидуальным размерам в Москве – купить недорого','','Мы занимаемся производством прихожих на заказ по индивидуальным размерам с доставкой в Москве и области. У нас можно недорого заказать прихожую со шкафом-купе в маленький коридор по своим размерам. Компания Lit-mebel, звоните!','<h2>Как сделать правильный выбор:</h2><ul><li>для маленьких прихожих шкаф-купе &mdash; идеальное решение. Для зрительного расширения пространства рекомендуется использовать больше зеркальных элементов;</li><li>особенным должен быть подход к обустройству прихожей в доме, где проживает большая семья &ndash; модули нужно подобрать так, чтобы в них без проблем помещалась повседневная одежда;</li><li>для удобства детей и пожилых людей можно предусмотреть выдвижные скамейки или пуфики;</li><li>важными по функциональному назначению являются шкафчики для хранения обуви, сумок, бижутерии.</li></ul><p>Даже в очень маленькое помещение можно вписать функциональную мебель. Хотите угодить себе и удивить гостей &ndash; обращайтесь в компанию Lit-mebel. Вы выбираете геометрию, функциональность, цвет и декор изделия, а мы воплощаем вашу идею в жизнь.</p><h2>Преимущества заказа у нас:</h2><table><tbody><tr><td style=\"width: 25%; text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/images/advantages/3 Выбор фурнитуры и материалов.png\" alt=\"\" /></td><td style=\"width: 25%; text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/images/advantages/1 Индивидуальный проект.png\" alt=\"\" /></td><td style=\"width: 25%; text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/cc_uploads/style.png\" alt=\"\" /></td><td style=\"width: 25%; text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/images/advantages/2 Выезд замерщика.png\" alt=\"\" /></td></tr><tr><td style=\"width: 25%; text-align: center;\"><strong>Невероятное разнообразие.</strong><br />Всегда доступен большой выбор фурнитуры и материалов отделки.</td><td style=\"width: 25%; text-align: center;\"><strong>Индивидуальный заказ.</strong><br />Мы сделаем мебель по любым Вашим пожеланиям и параметрам.</td><td style=\"width: 25%; text-align: center;\"><strong>Мебель любых стилей.</strong><br />От классики до модерна, от минимализма до хай-тека - мы можем всё!</td><td style=\"width: 25%; text-align: center;\"><strong>Выезд замерщика в удобное время.</strong><br />Практически в любое время, подробнее по телефону +7 (495) 132-13-13.</td></tr></tbody></table>','prih.png',1,'active_img3.png','Похожая прихожая',1,0,'','','specify'),(9,'2016-06-10 11:26:54','2019-08-30 15:45:02',NULL,'Комоды',1,80,'komody','Комоды на заказ','<p>Компания Lit-mebel изготавливает комоды на заказ по индивидуальным размерам. Вы можете выбрать любой из представленных в каталоге ниже комодов для прихожей, спальни или мы соберем эксклюзивный вариант по вашему дизайн-проекту.</p>','Комоды на заказ по индивидуальным размерам — заказать недорого в Москве, цены','комоды на заказ, цена, недорого','Компания Lit-mebel.ru занимается изготовлением комодов на заказ по индивидуальным размерам. У нас Вы можете заказать недорого комод по своему размеру в прихожую. Доставка, установка в Москве и Московской области. Гарантии качества!','<p>На что нужно обратить внимание:</p>\r\n<ul>\r\n<li>Вид комода: наши мастера могут изготовить разнообразные модели - от обычной для домашних мелочей до трансформера с функциональной поверхностью. С различными вариантами отделки, соответствующей общему интерьеру помещения.</li>\r\n<li>Размер: зависит от габаритов комнаты, иногда комод может заменить привычную стенку, не украв при этом пространство.</li>\r\n<li>Материал: массив дерева, МДФ, ДСП и др.</li>\r\n<li>Функционал: в зависимости от назначения комода, необходимо задуматься о количестве и размерах выдвижных ящиков или секций с дверцами.</li>\r\n</ul>\r\n<p>Наши специалисты учтут все ваши пожелания и изготовят для Вас качественную, стильную и оригинальную мебель.</p>','komod.png',1,'active_img5.png','Похожий комод',0,0,'','','specify');
